<header>
  <div class="logo-container" [class.show-logo]="showLogo" [class.nav-expanded]="isNavExpanded">

    <div *ngIf="isMobileTabletSize$ | async" class="d-logo-container">
      <img [class.show-logo]="showLogo" [class.nav-expanded]="isNavExpanded" src="../../../../assets/images/d_logo_outline.svg">
    </div>

    <div *ngIf="!(isMobileTabletSize$ | async)" class="full-logo-container">
      <!-- Dive Inn text -->
      <div>
        <img src="assets/images/logo/logo_0.svg" />
      </div>
      <!-- Woman head, torso, back arm and back leg -->
      <div>
        <img src="assets/images/logo/logo_1.svg" />
      </div>
      <!-- Diving board -->
      <div>
        <!-- <img class="board" src="assets/images/logo/logo_2.svg" /> -->
        <img class="football" src="assets/images/qb_challenge.png" />
      </div>
      <!-- Woman front arm and leg -->
      <div>
        <img src="assets/images/logo/logo_3.svg" />
      </div>
    </div>
